import FoodItem from '../components/FoodItem';
import React, { useState } from 'react';


function Order(props) {

    const item = props.examples.map(example => {
        return (
            <div key={example.id} className="col-md-5 m-1" >
                <FoodItem example={example} updateShoppingCart={props.updateShoppingCart} reset={props.reset} />
            </div>
        );
    });
    return (
        <div>
            <div className="container">
                <div className="row">
                    {item}
                </div>

            </div>
            <Button onClick={() => props.reset()}>reset</Button>

        </div>
    );
}

export default Order;
